const axios = require("axios");

axios({
    "method":"GET",
    "url":"https://qtravel-qtravel.p.rapidapi.com/apis",
    "headers":{
    "content-type":"application/octet-stream",
    "x-rapidapi-host":"qtravel-qtravel.p.rapidapi.com",
    "x-rapidapi-key":"c573d899fbmsh7f790eccbfa07a7p17edf7jsnf6b3cf11be53",
    "useQueryString":true
    },"params":{
    "query":"jungle aqua park",
    "qapikey":"125371768e33eb299b923ed3ca28e71c"
    }
    })
    .then((response) => {
        console.log(response)
    })
    .catch((error) => {
        console.log(error);
    });
